import React from "react";

import "./site.css";
import map from "./map";

import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
function Contact() {
  return (
    <Router>
      <Switch>
        <Route path="/Contact" exact component={map} id="app" />
      </Switch>
      <div className="address">
        Visit us: M. Valéry FRONTERE Appartement 12 Escalier C Résidence Les
        Tilleuls 1 impasse de l Eglise 01090 FRANCHELEINS FRANCE
      </div>
    </Router>
  );
}

export default Contact;
